import * as types from './mutation-types';

const mutations = {
  [types.SET_TAG_LIST](state, tagList) {
    state.tagList = tagList;
  },
  [types.SET_TAG_SUCCESS](state, tagSuccess) {
    state.tagSuccess = tagSuccess;
  }
}
export default mutations;
